import React, { useState } from "react";
import ReactDOM from "react-dom";
import Button from "./buttons";
import TextBox from "./textbox";

function App() {
  const [value, setValue] = useState(0);
  return (
    <>
      <div>
        <TextBox value={value} />
      </div>
      <div>
        <div>
          <Button number={1} value={value} setValue={setValue} />
          <Button number={2} value={value} setValue={setValue} />
          <Button number={3} value={value} setValue={setValue} />
        </div>
        <div>
          <Button number={4} value={value} setValue={setValue} />
          <Button number={5} value={value} setValue={setValue} />
          <Button number={6} value={value} setValue={setValue} />
        </div>
        <div>
          <Button number={7} value={value} setValue={setValue} />
          <Button number={8} value={value} setValue={setValue} />
          <Button number={9} value={value} setValue={setValue} />
        </div>
      </div>
    </>
  );
}

ReactDOM.render(<App />, document.getElementById("root"));
